import React, { useState, useEffect } from "react";
import "../style/Results.css";

function Results() {

    const [layovers, setLayovers] = useState(0);
    const [cost, setCost] = useState(0);
    const [time, setTime] = useState(0);

    return (

        <div className="App">

            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>

            <div class="container">
                <div class="row">
                    <div class="col-sm-4">
                        <h3>Column 1</h3>
                        <p>Lorem ipsum dolor..</p>
                    </div>
                    <div class="col-sm-4">
                        <h3>Column 2</h3>
                        <p>Lorem ipsum dolor..</p>
                    </div>
                    <div class="col-sm-4">
                        <h3>Column 3</h3>
                        <p>Lorem ipsum dolor..</p>
                    </div>
                </div>
            </div>

            <div className="App-body">
                <div className="Slider">
                    <h1>Layover Limits</h1>
                    <p>Move the slider to select how many layovers you are okay with having on your trip.</p>
                    <input
                        max={2}
                        type="range"
                        value={layovers}
                        onChange={(e) => setLayovers(e.target.valueAsNumber)}
                    />
                    <p>Total allowed layovers: {layovers}</p>
                </div>
                <div className="Slider">
                    <h1>Cost Limits</h1>
                    <p>Move the slider to choose how much you are willing to pay your trip.</p>
                    <input
                        max={100}
                        type="range"
                        value={cost}
                        onChange={(e) => setCost(e.target.valueAsNumber)}
                    />
                    <p>Maximum allowed cost: {cost*10}</p>
                </div>
                <div className="Slider">
                    <h1>Time Limits</h1>
                    <p>Move the slider to choose how long you are willing your trip to take.</p>
                    <input
                        max={288}
                        type="range"
                        value={time}
                        onChange={(e) => setTime(e.target.valueAsNumber)}
                    />
                    <p>Maximum allowed cost: {parseInt(time*5/60)} hr {time*5 % 60} min</p>
                </div>
            </div>
        </div>
    );
}

export default Results;
